    def process_data(self, port, change):
        # 변화량을 그대로 저장
        self.laser_changes[port].append(change)

    def calculate_weight_estimation(self, ports):
        # 4개 포트에 대해 변화량 평균을 계산합니다.
        avg_changes = np.mean([np.mean(self.laser_changes[port]) for port in ports])

        # 평균값을 상수값들과 비교하여 가장 근사한 값의 인덱스를 찾기
        closest_indices = {"mean": None, "mode": None, "median": None}
        for key in self.constants:
            # 가장 근사한 값을 찾고 그 값의 인덱스를 기록
            closest_value = min(self.constants[key], key=lambda x: abs(x - avg_changes))
            closest_index = self.constants[key].index(closest_value)
            closest_indices[key] = closest_index

        return closest_indices

